import React from 'react';
import email from './assets/mail-bulk-solid.svg';
import {
  ICON_ALT,
  WEBSITE_EMAIL,
  WEBSITE_EMAIL_LINK,
  WEBSITE_TITLE,
} from './constants';
import image from './assets/rachel-in-studio.jpeg';

function App() {
  return (
    <div className="flex justify-center items-center h-screen w-screen flex-col bg-gray-200">
      <header className="flex flex-col gap-y-8 text-center text-6xl relative z-10">
        <h1 className="font-pathway uppercase">{WEBSITE_TITLE}</h1>
        <p className="flex gap-x-2">
          <img src={email} alt={ICON_ALT} className="w-8 h-8" />
          <a href={WEBSITE_EMAIL_LINK} className="text-xl font-arvo">
            {WEBSITE_EMAIL}
          </a>
        </p>
      </header>
      <div>
        <img src={image} alt={MAIN_IMAGE_ALT} />
      </div>
    </div>
  );
}

export default App;
